import React from 'react';

import { Link } from 'react-router-dom';

function SearchedItems({ item }) {
  return (
    <div className="listing">
      <img src={item?.img} alt={item?.name} className="listing-image" />
      <div className="listing-info">
        <h3>{item.name}</h3>
        <Link className="text-success">{item?.timeOpen} </Link>
        {item?.address && <span>{item?.address}</span>}
        {item?.deliveryRate && <span>delivers {item?.deliveryRate}</span>}
        <span>{`${item.km}km away`}</span>
        <span className="text-danger">{item.status}</span>
      </div>
    </div>
  );
}

export default SearchedItems;
